import logo from './logo.svg';
import CampoTexto from '../CampoTexto';
import './App.css';

function App() {
  return (
    <CampoTexto
          value={nome}
          atualizar={valor => setNome(valor)}
          obrigatorio={true} label="Nome"
          placeholder="Digite seu nome" />
  );
}

export default App;
